import React from "react";
import { ForceGraph2D } from "react-force-graph";

const TestGraph = () => {
  const data = {
    nodes: [{ id: "A" }, { id: "B" }],
    links: [{ source: "A", target: "B" }],
  };

  return (
    <div style={{ height: "600px", width: "100%", background: "white" }}>
      <ForceGraph2D graphData={data} />
    </div>
  );
};

export default TestGraph;
